import React from 'react'
import Link from 'next/link'

const NavBar = () => {
    return (
        <div className='bg-gray-500 py-4'>
            <Link href='/sobre'>Sobre</Link>
            <Link href='/cadastro'>Cadastre-Se </Link>
            <Link href='/entrar'>Entrar</Link>
        </div>
    )
}

export default NavBar
